webpackJsonp([0xac0c9eb7e594],{7671:function(e,t){e.exports={data:{post:{html:'<p>My MacBook wouldn\'t wake up this morning, and worse than that, it wouldn\'t even start. It would chime and get stuck on a blue screen, the default background color (nicer than Windows blue screen), similar to the problem described <a href="http://forums.macrumors.com/showthread.php?t=222380">here</a>.</p>\n<p>I started from the Install DVD, and after that the installed system started up just fine, but it was unnerving nonetheless. So <a href="http://www.scripting.com/2006/08/15.html#yesVirginiaMacsCrashToo">Macs really do crash</a>... :-)</p>',fields:{title:"MacBook Blue Screen",date:"24 Aug 2006",url:"https://papascott.de/2006-08-24-macbook-blue-screen/"}}},pathContext:{slug:"/2006-08-24-macbook-blue-screen/",prev:{fields:{title:"Captain Christopher",date:"24 Aug 2006",slug:"/2006-08-24-captain-christopher/"}},next:{fields:{title:"Nico Ballmer",date:"25 Aug 2006",slug:"/2006-08-25-nico-ballmer/"}}}}}});
